import React, { Component } from "react";
import "./header.css";
class Head extends Component {
  state = {
    headLogo: "https://imgur.com/gpvVWGa.jpg",
    myVid: (
      <iframe
        width="1280"
        height="720"
        src="https://www.youtube.com/embed/ojcNcvb1olg"
        frameborder="0"
        allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture"
        allowfullscreen
        title="Youtube Video"
      ></iframe>
    ),
    img1: "https://imgur.com/TkOQXak.png",
    img2: "https://imgur.com/1WtBNmz.png",
    img3: "https://imgur.com/9aoBRUh.jpg",
    img4: "https://imgur.com/gz0dTdT.jpg",
    myIndex:
      "https://uc927a993569d2c2614b7efc716c.previews.dropboxusercontent.com/p/orig/AAswOn4nQPjyw7AdUUSVj4-P36E4uXN3G7NJalUSVY1Ad5PFighCPzAHlJyWLI7Qe4EeR-BTKxvf6noUX7fEiFXqIoiqu7-m161LSATuZz1sytt3XcOSYLCo8rfK9A4882X9H3EodubvdVLNhH6o6xIpT5EwWiyE_iC4KlEj0kVYKeTUneLNUvdncrREs_FpainsXxPDQf9d0Gsy0XqVILVFpaytWMEvjZZvPPVxDpS1DpISnR6F9fryFtEgljjkVR_wcR5Esbbma7BljDiIIdxJCYboHqE7p8zX6H3zCRMeiZF8NA-wgR-ddc4ce63oh11aP_d4Qh6uTe-vXKXKIyA18xkLr2u537Lf8DHc7aPp-OV9yyUHWeMw4HEkwXh_W9M/p.svg?fv_content=true&size_mode=5.svg"
  };
  render() {
    return (
      <div className="further-info">
        <h1>Mozilla!</h1>
        <img id="img1" src={this.state.headLogo} alt="" />
        <article>{this.state.myVid}</article>
        <img src={this.state.img1} alt="" />
        <img src={this.state.img2} alt="" />
        <img src={this.state.img3} alt="" />
        <img src={this.state.myIndex} alt="bruh juust load pls" />
        <img src={this.state.img4} alt="" />
      </div>
    );
  }
}

export default Head;
